--
-- テーブルの構造 `m_store_manage`
--

CREATE TABLE `m_store_manage` (
  `store_id` int(11) NOT NULL COMMENT '店舗コード',
  `store_name` varchar(250) NOT NULL COMMENT '店舗名',
  `store_addr` varchar(500) NOT NULL COMMENT '店舗アドレス',
  `store_post` varchar(100) NOT NULL COMMENT '店舗郵便番号',
  `store_ido` decimal(20,8) NOT NULL COMMENT '店舗緯度',
  `store_keido` decimal(20,8) NOT NULL COMMENT '店舗経度',
  `store_type` varchar(100) NOT NULL COMMENT '店舗フォーマット',
  `store_azure` tinyint(1) NOT NULL COMMENT '店舗Azureタイプ0:パイロット環境 1:メイン環境',
  `coupon_flag` bit(1) NOT NULL DEFAULT b'0' COMMENT 'クーポン展開フラグ',
  `scango_flag` bit(1) NOT NULL DEFAULT b'0' COMMENT '決済フラグ',
  `preorder_flag` bit(1) NOT NULL DEFAULT b'0' COMMENT 'プレオーダーフラグ',
  `prodsearch_flag` bit(1) NOT NULL DEFAULT b'0' COMMENT '商品検索フラグ',
  `pickupflag_flag` bit(1) NOT NULL DEFAULT b'0' COMMENT 'ピックアップ展開フラグ',
  `is_receipt` bit(1) NOT NULL DEFAULT b'0' COMMENT '受取フラグ',
  `store_name_abbr` varchar(250) DEFAULT NULL COMMENT 'ピックアップ店舗別名'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

--
-- テーブルのデータのダンプ `m_store_manage`
--


--
-- テーブルのインデックス `m_store_manage`
--
ALTER TABLE `m_store_manage`
  ADD PRIMARY KEY (`store_id`),
  ADD UNIQUE KEY `store_id` (`store_id`);
